import React from 'react'
import { useState ,useEffect ,axios} from 'react'

export default function Consultant() {

  const [users, setUsers] = useState([])

  useEffect(() => {
    axios.get('http://localhost:4000/ConsaltantHome').then(response=>setUsers(response.data)).catch(err => console.log(err))
   
  }, [])
  

  return (
    <div>Hears Consultant Page
    
    {users.map(user => {
      <p key={user.id}>{user.name}</p>
    })}

    </div>
  )
}
